import logo from './logo.svg';
import './App.css';
import React from 'react';

import Cabecera from './Biblioteca/Ejercicio1/Cabecera';
import Menu from './Biblioteca/Ejercicio1/Menu';
import PiePagina from './Biblioteca/Ejercicio1/PiePagina';
import Contenedor from './Biblioteca/Ejercicio1/Contenedor';
import Informacion from './Biblioteca/Ejercicio1/Informacion';
import Peliculas from './Biblioteca/Ejercicio2/Peliculas';




function App() {
  return (
    <React.Fragment>
    <Contenedor>
        <Cabecera titulo="DePeli"></Cabecera>
        <Menu></Menu>
        <Informacion>
          <Peliculas/>
        </Informacion>
        <PiePagina nombre="DePeli" correo="adp@iespacomolla.es"></PiePagina>
      </Contenedor>
</React.Fragment>

  );
}

export default App;
